// country_picker_state.dart

import 'package:equatable/equatable.dart';
import 'package:fl_country_code_picker/fl_country_code_picker.dart';

class CountryPickerState extends Equatable {
  final CountryCode selectedCountry;

  const CountryPickerState({required this.selectedCountry});

  // Set the default country to Romania
  factory CountryPickerState.initial() => CountryPickerState(
      selectedCountry: const CountryCode(name: 'Romania', code: 'RO', dialCode: '+40'));

  CountryPickerState copyWith({CountryCode? selectedCountry}) {
    return CountryPickerState(
      selectedCountry: selectedCountry ?? this.selectedCountry,
    );
  }

  @override
  List<Object?> get props => [selectedCountry];
}
